import React from 'react';
import './App.css';
import QuizForm from './Quiz/QuizForm/QuizForm';

const colors = {
  blue: "#03619c",
  yellow: "#8c8f03",
  red: "#9c0312"
};

export const ColorContext = React.createContext(colors);



function App() {

     return (
       <div>
         <ColorContext.Provider value={colors}>
           <QuizForm />
          </ColorContext.Provider>

      </div>
  );
}

export default App;
